export const SET_DEADLINE =  '[taskToClass] SET_DEADLINE';


export const updateClasses = (payload) =>({
  type: UPDATE_CLASSES,
  payload
})

export const setDeadLine = (payload) =>({
  type: SET_DEADLINE,
  payload
})
